import React from 'react';
import './UserInput.css';
const userInput = (props) => {
    return (
        <div className="input">
            Name: <input className="name" type="text" onChange={props.changename} placeholder="Enter New Name" value={props.currentname} />
            <input className="name" type="text" onChange={props.changeage} placeholder="Enter New Age" value={props.currentage} />
        </div>
        
    )
};
export default userInput;
